    - type: Paper
      content: >
        [head=2]CRYOGENIC TREATMENT BRIEFING[/head]

        [head=3]by E. Flameheart, Nanotrasen Surgeon General[/head]

        [italic]Written 7/10/FY2966, reprinted for FY2974[/italic]


        Brief explanations to each step are provided. A standard cryogenics installation on a Nanotrasen research station will have all components installed with only the listed steps required.

        ---------------------------------------------------------------------------------------------

        [bold]1. Turn on the air supply and waste filter.[/bold]

        The cryogenics pods are essentially sanitary atmospheric isolation chambers designed to be extremely hot or cold without impacting the surrounding environment, while also preventing the patient from experiencing much of the ill effects of such an enviroment.


        In order to prevent the occupant from suffocating, you need to supply breathable air from the atmospheric distribution network ("distro") and filter carbon dioxide from the cryogenics air supply system.


        [bold]2. Turn on the supplied freezer and set it to 213 K or lower.[/bold]

        The freezer cools the gases in the atmospheric pipe network it is attached to. In order to effectively heal, cryogenic chemicals require the metabolizing body to be under 213 K.


        [bold]3. Remove any insulative clothing from the patient.[/bold]

        Insulative clothing (such as hardsuits, voidsuits, EVA suits, and winter clothes) should be removed as they impede the cooling of the patient in the cryogenics pod.


        [bold]4. Scan the patient to keep track of injuries.[/bold]

        It is important to do this before the patient is placed in the pod, as the medical scanners that come pre-installed on the PDAs of medical staff cannot read through the glass of the pod. If you shut off the scanner, you will have to remove the patient and re-scan in order to keep track of the status of their injuries.


        [bold]5. Place a beaker with the preferred cryogenic chemical into the slot on the cryopod.[/bold]

        Cryoxadone is the most common cryogenics chemical. Medical bays are often stocked with it at the beginning of shifts, and it is exceptionally cheap to produce for how effective it is as medicine.


        Other chemicals are desirable for their ability to work on the dead, with cryoxadone cannot accomplish.


        [bold]6. Insert the patient into the cryogenics pod.[/bold]

        Simply drag the patient into the cryogenics pod and they will start cooling. The patient will experience minor asphyxiation and frostbite, but they will quickly heal it off as soon as they hit critical temperature for cryoxadone activation.


        [bold]7. Remove the patient from the pod once they stop healing.[/bold]

        As soon as you see the patient becoming afflicted with asphyxiation after healing, remove them from the cryogenics pod as soon as possible. They need to warm up quickly as not to incur further damage from frostbite, so a space heater may be desirable if available.


        [bold]ADDENDUM 1: Pyrogenic chemicals[/bold]

        There are a number of chemicals that behave like cryogenic chemicals, but they activate in the body upon reaching a high temperature instead of a low one. These are called pyrogenic chemicals and tend to be more powerful than cryogenic ones at the cost of great risk.


        In the event you wish to use pyrogenic chemical you can convert the functionality of your freezer to that of a heater by partially deconstructing the freezer, taking the machine board in your hand, and applying a screwdriver to the control circuit, and re-assembling the machine. This, however, is relatively advanced and is best advised for medical staff with ample engineering or R&D experience.


        [bold]ADDENDUM 2: Dire measures[/bold]

        At a research station, whether on a celestial body or orbiting one, there's always the possibility of a situation where you'll have no access to a proper cryogenics setup. Just keep in mind that the only condition you strictly need to activate cryogenic or pyrogenic chemicals is temperature, and the pods are far from the only way to achieve that.
